ISLAMABAD, Jan 8 (APP):Speaker National Assembly Raja Pervez Ashraf Monday called on caretaker Prime Minister Anwaar-ul-Haq Kakar here and discussed matters of mutual concerns.
During the meeting, they also discussed the overall political situation of the country, a statement issued by the Prime Minister Office Press Wing said.
